Installige laiendus AudD ja klõpsake selle ikoonil, et tuvastada praegusel vahekaardil esitatav lugu.
Vaadake ülaltoodud videot, et näha, kuidas see töötab.

AudD laiendus:
- tuvastab teie brauseris mängitava muusika;
- Otsib oma muusikatuvastustehnoloogia abil AudD andmebaasist enam kui 75 miljoni looga muusikat;
- Näitab tuvastatud laulude sõnu;
- Näitab linke, et kuulata lugusid teenuses Apple Music, Spotify, Deezer, YouTube Music;
- Kuvab tuvastatud loo täpse hetke, mil brauserist pärit heli esitatakse.

Muusikatuvastuse API: https://audd.io
Lähtekood: https://github.com/AudDMusic/chrome-extension

Laiendust toetab AudD® muusikatuvastuse API

Loonud ja kujundanud AudD.io meeskond Eric Starki, Mitchell Kossorise ja Ivan Kasatkini abiga.
